import { useEffect, useState } from 'react';
import {axios} from 'axios';

function Home() {
  const [data, setData] = useState(null);

  useEffect(() => {
    axios.get('/prueba')  
      .then(response => {
        setData(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div>
      {data ? (
        <p>{data.message}</p>
      ) : (
        <p>Cargando...</p>
      )}
    </div>
  );
}

export default Home;
